'''Parroty Pete''' is an employee at [[Ardougne Zoo]] who cares for the [[Parrots|parrots]], plays a small role in [[Eadgar's Ruse]] and is often seen chatting to [[Postie Pete]], his brother. Postie reveals that Parroty's pay is quite low.

He is suspected to be the brother of [[Party Pete]], in the Falador Party Room. Parroty Pete is apparently also the brother of [[Pirate Pete]], [[Prison Pete]], and [[Postie Pete]].

